var LRUCache=function(){function t(t){this.items=[],this.capacity=t}return t.prototype.add=function(t){this.items.length>=this.capacity&&this.removeOldest(),this.items.push(t)},t.prototype.removeOldest=function(){this.items.shift()},t.prototype.getItems=function(){return this.items},t.prototype.remove=function(t){this.items.splice(this.items.indexOf(t),1),delete this.items[t]},t.prototype.getCapacity=function(){return this.capacity},t.prototype.getSize=function(){return this.items.length},t}();